import { useEffect } from 'react';

const url = 'https://drive.google.com/file/d/1rtaJl6mhaV4cUl2Qwe3WlkkJLFiofRTd/view?usp=sharing'

function Home() {

  const [userData, setUserData] = useState({});

  useEffect(() => {
    getInfo();
  }, []);

  const getInfo = async () => {};

